//funcion que dibuja una corona (circulo azul alrededor del diente)
function dibujar_corona(canvas,px,py,num){
	if (canvas.getContext) {
		 var ctx = canvas.getContext('2d');
		 var k = (39*num);
	ctx.beginPath();
	ctx.arc((px+k),py,20,0,Math.PI*2,true);
	ctx.fillStyle="rgba(255,255,0,0)";
	ctx.fill();
	ctx.lineWidth = 3;
	ctx.strokeStyle = "blue";
	ctx.stroke();
	}
}
